(function(){function e(e){try{var n,t=e.currentTarget;if(!t||t.dataset.cvWarning!=="true")return;n=t.dataset.cvMessage||"This CV may be outdated. Continue to download?",window.confirm(n)||(e.preventDefault(),e.stopPropagation())}catch{}}document.addEventListener("DOMContentLoaded",function(){document.querySelectorAll('a.cv-link[data-cv-warning="true"]').forEach(function(t){t.addEventListener("click",e,{capture:!0})})})})()